import React from "react";

const Footer = () => {
  return (
    <>
      <footer>
        <h2>Contact</h2>
        <div className="tel"></div>
        <div className="email"></div>
        <div className="adress"></div>
      </footer>
      <div className="animBorder"></div>
    </>
  );
};

export default Footer;
